INSERT INTO `categorys` VALUES (1,'CTCH','Cho thuê căn hộ','Cho Thuê Căn Hộ Chung Cư, Giá Rẻ, View Đẹp, Mới Nhất 2024','Cho thuê căn hộ - Kênh đăng tin cho thuê căn hộ số 1: giá rẻ, chính chủ, đầy đủ tiện nghi. Cho thuê chung cư với nhiều mức giá, diện tích cho thuê khác nhau.','2024-05-30 17:01:05','2024-05-30 17:01:05'),(2,'CTMB','Cho thuê mặt bằng','Cho Thuê Mặt Bằng, Văn Phòng Kinh Doanh, Giá Rẻ, Mới Nhất 2024','Có 3.135 tin đăng cho thuê mặt bằng, văn phòng kinh doanh. Giá rẻ, gần chợ, trường học, tiện mở quán ăn, cafe. Đăng tin mặt bằng, văn phòng hiệu quả tại Phongtro123.com','2024-05-30 17:01:09','2024-05-30 17:01:09'),(3,'CTPT','Cho thuê phòng trọ','Cho Thuê Phòng Trọ, Giá Rẻ, Tiện Nghi, Mới Nhất 2024','Cho thuê phòng trọ - Kênh thông tin số 1 về phòng trọ giá rẻ, phòng trọ sinh viên, phòng trọ cao cấp mới nhất năm 2024. Tất cả nhà trọ cho thuê giá tốt nhất tại Việt Nam.','2024-05-30 17:01:12','2024-05-30 17:01:12'),(4,'NCT','Nhà cho thuê','Cho Thuê Nhà Nguyên Căn, Giá Rẻ, Chính Chủ, Mới Nhất 2024','\"Cho thuê nhà nguyên căn, nhà riêng: giá rẻ, chính chủ, đầy đủ tiện nghi. Tìm thuê nhà với nhiều mức giá khác nhau, đa dạng loại diện tích. Đăng tin cho thuê nhà nhanh, hiệu quả tại phongtro123.com.','2024-05-30 17:01:15','2024-05-30 17:01:15');
