INSERT INTO `posts` VALUES ('07259659-cded-4b0a-806e-037afdea28b6','Cho thuê kiot lớn 50m2, mặt tiền đường,làm kiot bán hàng,vừa ở, mặt đường bờ sông đẹp','0','XGS2','Địa chỉ: 401/23 Đường Bình Lợi, Phường 13, Quận Bình Thạnh, Hồ Chí Minh','433b92e7-22eb-446b-a23c-cd0f8859a4ce','CTMB','[\"Phòng rộng mặt tiền đường, rất thuận tiện có thể vừa ở vừa kinh doanh, đường trước nhà rộng 20m bờ sông rất thoáng, bên cạnh là công viên thoáng mát.\",\"Diện tích 4x12m = 48m2\",\"Khu dân cư cao cấp, đông đúc, an ninh, thích hợp gia đình ở, hoạc kinh doanh,Kinh doanh online, cắt tóc, quán ăn, làm kho....\",\"Mặt đường bờ sông rộng vô cùng thoáng mát, không gian đẹp, bên cạnh công viên, khu sầm uất đông đúc.\",\"giá cho thuê: 6tr/tháng ( hợp đồng lâu dài )\",\"LH: 0902 400 145 gặp A. Hưởng củ nhà.\",\"Địa chỉ: 401/23 - đường Bình Lợi - P13 - Bình Thạnh\"]','9105ec8a-e693-405b-9058-baadce60a759','58da79c2-9d30-4bd3-b5bf-01f1c431abf2',NULL,'2024-05-30 09:31:38','2024-05-30 09:31:38'),('09d8d121-708d-41fd-b4ef-cc2682215103','PHÒNG CHO THUÊ NGAY LOTTE Q.7 - CHỈ TỪ 3.6TR - BAO GIÁ TỐT - Alo 0988.373.731','0','KXR6','Địa chỉ: 80 Đường số 3, Phường Tân Kiểng, Quận 7, Hồ Chí Minh','fba6bae2-78db-425e-8c5e-d40c5679b74a','CTPT','[\"Các tiện ích chỉ có ở tại Fullhouse ngay Lotte Q.7. 100% dân trí cao, Sạch đẹp - Văn minh - Nhân ái\",\"Ngay Lotte Q.7 (đi bộ 2 phút đến đại siêu thị)! Alo ngay: 0988.373.731 Ms Hòa.\",\"Căn phòng dành cho bạn thì đầy đủ tiện nghi, tiết kiệm điện và bảo vệ môi trường với hệ đèn LED - Nước nóng năng lượng mặt trời - Máy lạnh Inverter - WC và bếp riêng tiện nghi và tự do.\",\"Tòa nhà luôn được vệ sinh sạch sẽ để bảo vệ sức khỏa toàn bộ dân cư.Tòa nhà xài hệ thống NLMT và máy lạnh Inverter giúp tiết kiệm điện.\",\"Tòa nhà 7 tầng mới xây sạch,đẹp,văn minh thoáng mát, an ninh. Liền kề 5 phút đến Q1, Q4, Q5, Q8, Crescent Mall, SC Vivo, vị trí vàng đẹp Q. 7...Thuê chỗ ở bây giờ cần phải đảm bảo an toàn PCCC tuyệt đối. Tòa nhà căn hộ cho thuê cao cấp của chúng tôi có thẩm