diện tích ~100m2 ( 7m x 14m ).\",\"Gồm đầy đủ các thiết bị cao cấp :\",\" Máy Pos, Máy xay sinh tố công nghiệp, Máy xay cà phê, Máy pha cà phê đôi, Máy ép nước, Màn hình cảm ứng …\",\"Bàn ghế cao cấp và chất lượng được thiết kế riêng (15 bộ bàn và 54 ghế lớn)\",\"Quầy pha chế và toàn bộ dụng cụ pha chế cao cấp\",\"Máy lạnh, Hệ thống camera an ninh giám sát\",\"Dàn âm thanh trần, WC riêng sang và sạch sẽ\",\"Đồng hồ điện riêng biệt.\",\"...Nhiều vật dụng khác nữa.\",\"Giá sang quán cafe cũng toàn bộ thiết bị : 250 triệu ( không bao gồm phần tiền cọc 100 triệu với chủ nhà)\",\"Giá thuê mặt bằng kinh doanh : 23 triệu / 1 tháng, hợp đồng ký mới lâu dài với chủ nhà.\",\"Địa chỉ: 7A/9 Thành Thái, P.14, Quận 10 (Mặt tiền đường lớn rộng 20m 7A Thành Thái)\",\"Liên Hệ: 0937554570 (A.Hoàng).\"]','42b499fa-805b-432c-b029-87a851725d1b','92bb3a04-e50d-44df-a15f-fca81af1558e',NULL,'2024-05-30 09:31:38','2024-05-30 09:31:38'),('cedba313-3a82-4304-a26c-03853e342b3e','PHÒNG TRỌ CAO CẤP TẠI QUẬN TÂN BÌNH','0','VWG1','Địa chỉ: 202/31 Đường Phạm Văn Hai, Phường 4, Quận Tân Bình, Hồ Chí Minh','82cd7494-347f-49da-90aa-0d85c839b944','CTPT','[\"Giá 3tr/ tháng\",\"Cách sân bay Tân Sơn Nhất 3 phút đi xe máy\",\"Cách chợ Phạm Văn Hai 1 phút xe máy\",\"Rất gần Quận 1 và Quận 3 : di chuyển thuận lợi bằng đường Hoàng Sa Trường Sa.\",\"Tiện ích xung quanh gồm Biện Viện, Trường Học, Chợ, Siêu Thị, Nằm rất gần bờ kè kênh Nhiêu Lộc nên rất thuận tiện đi làm về giờ tan tầm, tránh được kẹt xe.\",\"Diện tích mỗi phòng từ 25m2 đến 27m2 có tầng lửng cho bạn không gian sống riêng tư cho dù bạn là gia đình nhỏ hay nhóm bạn ở chung\",\"Khu vực an ninh, yên tĩnh, thuận tiện trong mọi sinh hoạt\",\"Có bãi gửi xe riêng cho không gian sống them rộng mở.\",\"Bảo vệ an ninh 24/7 bảo đảm cho bạn và tài sản của bạn.\",\"Dịch vụ linh hoạt tùy thuộc vào nhu cầu của bạn.\",\"Không gian RIÊNG TƯ, YÊN TĨNH, TỰ DO, không bị ai làm phiền.\",\"Bạn được TỰ DO TIẾP KHÁCH người thân, bạn bè.\",\"Vệ sinh sạch sẽ không gian sử 